import React, { useState, useEffect } from 'react';

function AddPhoneData() {
  const [phoneData, setPhoneData] = useState([]);
  const [latitude, setLatitude] = useState('');
  const [longitude, setLongitude] = useState('');
  const[uploaded, setUploaded] = useState(false);

  useEffect(() => {
    getPhoneData();
  }, []);

  const getPhoneData = async () => {
    try {
      const res = await fetch('http://localhost:3001/phoneData');
      const data = await res.json();
      setPhoneData(data);
    } catch (error) {
      console.error('Error fetching phone data:', error);
    }
  };

   async function onSubmit(e){
        e.preventDefault();

        // if(!name){
        //     alert("Vnesite ime!");
        //     return;
        // }

        const formData = new FormData();
        formData.append('latitude', latitude);
        formData.append('longitude', longitude);
        const res = await fetch('http://localhost:3001/phoneData', {
            method: 'POST',
            credentials: 'include',
            body: formData
        });
        const data = await res.json();

        setUploaded(true);
    }

    return (
        // <form className="form-group" onSubmit={onSubmit}>
        //     {!userContext.user ? <Navigate replace to="/login" /> : ""}
        //     {uploaded ? <Navigate replace to="/" /> : ""}
        //     <input type="text" className="form-control" name="ime" placeholder="Ime slike" value={name} onChange={(e)=>{setName(e.target.value)}}/>
        //     <label>Izberi sliko</label>
        //     <input type="file" id="file" onChange={(e)=>{setFile(e.target.files[0])}}/>
        //     <input className="btn btn-primary" type="submit" name="submit" value="Naloži" />
        // </form>
         <form onSubmit={onSubmit}>
            <label>
            Latitude:
            <input type="number" value={latitude} onChange={(e) => setLatitude(e.target.value)} required/>
            </label>
            <br />
            <label>
            Longitude:
            <input type="number" value={longitude} onChange={(e) => setLongitude(e.target.value)} required/>
            </label>
            <br />
            <button type="submit">Add Phone Data</button>
       </form>
    )

  return (
    <div>
      <h3>Photos:</h3>
      <ul>
        {phoneData.map((item) => (
          <li key={item._id}>
            Latitude: {item.latitude}, Longitude: {item.longitude}
          </li>
        ))}
      </ul>

      <form onSubmit={addPhoneData}>
        <label>
          Latitude:
          <input type="number" value={latitude} onChange={(e) => setLatitude(e.target.value)} required/>
        </label>
        <br />
        <label>
          Longitude:
          <input type="number" value={longitude} onChange={(e) => setLongitude(e.target.value)} required/>
        </label>
        <br />
        <button type="submit">Add Phone Data</button>
      </form>
    </div>
  );
}

export default AddPhoneData;
